import React from "react";
import './navbar.css';

const Navbar = () => {
return(
    <nav className="NavBar">
        <img src="./LogoU.jpg" alt="" height={70} width={70}/> {/* For logo  */}
        <div className="desktopmenu"> {/* For Navbar menus */}

        </div>
        <button className="desktopmenubtn">
            <img src="" alt="" className="desktopmenubtnx" /> Contact Me 
        </button>
    </nav>

)};

export default Navbar;
